        var e = tone[2];
        var a = (e&16)/16;
        this.setPianoKeyAttribute(tone[2], 40);

        do {
          this.buffer[Math.round(this.frames*k)] = ((a == 0) ? 0.0 : 0.3);
          this.frames++;
          d--;
          if (d == 0) {
            d = tone[1];
            a = Math.abs(a-1);
          }
          e--;
          if (e == 0) {
            e = tone[2];
            a = Math.abs(a-1);
          }
          c--;
        } while (c > 0)
        a = tone[1];
        this.setPianoKeyAttribute(tone[1], 56);
        a = tone[2];
        this.setPianoKeyAttribute(tone[2], 56);
